Dieser Kurzfilm gewährt einen Einblick in das Leben meines Klienten @jagasilvio, den ich die letzten 7 Monate im Bereich der Gewichtsreduktion begleiten durfte. Seine Geschichte kann für jeden nur als Motivation dienen, bei der man sich selbst die Frage stellen darf: Was ist meine Ausrede? Ich bin mehr als stolz auf deinen Willen, trotz der Umstände immer weiter an deinem Weg zurück ins Leben zu arbeiten! 

‚Ich hatte das Glück, vor kurzem Teil eines Studienprojekts zu sein. Seitdem ist schon etwas Zeit vergangen, doch die vielen Eindrücke und Erfahrungen, die ich mitnahm und der Spaß, den man dabei hat, haben in mir den Gedenken nur verstärkt, dass dies sicherlich nicht der letzte Kurzfilm war.‘ - Silvio

